import React, { useState } from "react";
import axios from "axios";

function App() {
  const [url, setUrl] = useState("");
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const checkUrl = async () => {
    if (!url) {
      setError("⚠ Please enter a URL.");
      return;
    }

    setLoading(true);
    setError("");
    setResult(null);

    try {
      const res = await axios.get(
        `http://127.0.0.1:8000/predict-url?url=${encodeURIComponent(url)}`
      );
      setResult(res.data);
    } catch (err) {
      setError("⚠ Backend not reachable.");
    }

    setLoading(false);
  };

  return (
    <div style={styles.page}>
      <div style={styles.card}>
        <h1 style={styles.title}>⚡ CyberPunk URL Scanner</h1>

        <input
          type="text"
          placeholder="Enter a URL…"
          value={url}
          onChange={(e) => setUrl(e.target.value)}
          style={styles.input}
        />

        <button onClick={checkUrl} style={styles.button}>
          ⚡ Scan URL
        </button>

        {loading && <p style={styles.loading}>⏳ Scanning...</p>}
        {error && <p style={styles.error}>{error}</p>}

        {result && (
          <div style={styles.resultBox}>
            <h2 style={styles.resultTitle}>SCAN RESULT</h2>

            <p style={styles.resultText}>
              <b>Final Prediction:</b>{" "}
              <span
                style={{
                  color:
                    result.final_prediction === "Phishing"
                      ? "#ff2e63"
                      : "#08f7fe",
                }}
              >
                {result.final_prediction}
              </span>
            </p>

            <p style={styles.resultText}>
              <b>ML Prediction:</b> {result.ml_prediction}{" "}
              <span style={{ opacity: 0.8 }}>
                {result.ml_prediction === 1 ? "(Phishing)" : "(Legitimate)"}
              </span>
            </p>

            <p style={styles.resultText}>
              <b>ML Probability:</b>{" "}
              {(result.ml_probability * 100).toFixed(2)}%
            </p>
          </div>
        )}
      </div>
    </div>
  );
}

// ---------------- CYBERPUNK STYLES ----------------

const styles = {
  page: {
    background: "linear-gradient(135deg, #0d0221, #190040, #3a0ca3)",
    minHeight: "100vh",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    padding: "20px",
    fontFamily: "'Orbitron', sans-serif",
    color: "#fff",
  },

  card: {
    width: "100%",
    maxWidth: "600px",
    padding: "35px",
    borderRadius: "20px",
    background: "rgba(20, 0, 40, 0.6)",
    backdropFilter: "blur(10px)",
    boxShadow:
      "0 0 20px #ff2e63, 0 0 40px #08f7fe inset, 0 0 80px rgba(255,255,255,0.1)",
    textAlign: "center",
    border: "2px solid rgba(255,255,255,0.2)",
  },

  title: {
    fontSize: "32px",
    marginBottom: "25px",
    color: "#08f7fe",
    textShadow: "0 0 10px #08f7fe, 0 0 20px #ff2e63",
  },

  input: {
    width: "100%",
    padding: "14px",
    borderRadius: "12px",
    border: "2px solid #ff2e63",
    background: "rgba(255,255,255,0.1)",
    fontSize: "16px",
    color: "#fff",
    outline: "none",
    marginBottom: "20px",
    boxShadow: "0 0 10px #ff2e63",
  },

  button: {
    width: "100%",
    padding: "14px",
    borderRadius: "12px",
    border: "none",
    background:
      "linear-gradient(135deg, #ff2e63, #fb05a0, #08f7fe, #3a86ff)",
    color: "#fff",
    fontSize: "18px",
    fontWeight: "bold",
    cursor: "pointer",
    textShadow: "0 0 5px #000",
    boxShadow:
      "0 0 10px #08f7fe, 0 0 20px #3a86ff, 0 0 40px rgba(255,255,255,0.2)",
    transition: "0.3s",
  },

  loading: { marginTop: "20px", fontSize: "18px", color: "#08f7fe" },

  error: { marginTop: "20px", fontSize: "18px", color: "#ff2e63" },

  resultBox: {
    marginTop: "30px",
    padding: "25px",
    borderRadius: "12px",
    background: "rgba(255, 255, 255, 0.05)",
    border: "2px solid rgba(255,255,255,0.2)",
    boxShadow: "0 0 25px #08f7fe inset, 0 0 45px #ff2e63",
  },

  resultTitle: {
    fontSize: "24px",
    marginBottom: "15px",
    color: "#ff2e63",
    textShadow: "0 0 10px #ff2e63",
  },

  resultText: {
    fontSize: "18px",
    marginBottom: "10px",
    color: "#eee",
  },
};

export default App;
